if __name__ == '__main__':
    # 布局
    layout = [
        [sg.Frame(title='常驻', title_color='black', layout=layout_up)],
        [sg.Col(layout_down_left, vertical_alignment='top'), sg.Col(layout_down_right, vertical_alignment='top')]

    ]

    # 创建窗口
    window = sg.Window(
        'SVN日志管理工具',
        layout,
        element_padding=(5, 5),
        button_color=('yellow', 'pink'),
        resizable=True,
        element_justification='c',
        # background_color='white'
    )

    # 事件循环
    while True:
        event, values = window.read(timeout=10)

        window['-LOADING-'].update_animation(
            source=sg.DEFAULT_BASE64_LOADING_GIF,
            time_between_frames=100
        )

        if event == sg.WIN_CLOSED or event == None:
            break

        if event == '-UPDATE-':
            new_user = values['-USERNAME-']
            new_pass = values['-PASSWORD-']

            if new_user == '' or new_pass == '':
                sg.PopupError('用户名或密码不能为空！')
            else:
                if username != new_user and new_user != '':
                    rc.set_username(new_user)
                    rc.set_password(new_pass)

                rc.username = new_user
                rc.password = new_pass

                sg.popup("更新成功，请保证账号有权限访问接下来配置的目录", auto_close=True)
                sg.cprint(f"已更新为新用户：{new_user}")

        if event == '-Cal1-' or event == '-Cal2-':
            new_start_date = '{' + values['-Cal1-'] + '}'
            new_end_date = '{' + values['-Cal2-'] + '}'

            if rc.start_date == '{}' or rc.end_date == '{}':
                rc.set_start_date(new_start_date)
                rc.set_end_date(new_end_date)

            rc.start_date = new_start_date
            rc.end_date = new_end_date

            sg.cprint(f'当前时间范围：{new_start_date}-{new_end_date}')

        if event == '-IMPORT-':
            import_path = values['-IMPORT-']
            sg.cprint(f'配置文件：{import_path}')

        if event == '-EXPORT-':
            export_path = values['-EXPORT-']
            sg.cprint(f'导出路径：{export_path}')

        if event == '-RUN-':
            sg.cprint('='*50)
            window['-LOADING-'].update(visible=True)
            # window['-END-'].update(visible=False)
            window.Refresh()

            sg.cprint(
                dt.datetime.now().strftime('%Y-%m-%d %H:%M:%S'), '程序开始运行...',
                sep='，',
                text_color='green',
                justification='l'
            )
            window.Refresh()

            rc.start_date = '{' + values['-Cal1-'] + '}'
            rc.end_date = '{' + values['-Cal2-'] + '}'
            import_path = values['-IMPORT-']
            export_path = values['-EXPORT-']

            if rc.username == '':
                sg.cprint('用户名不能为空。', text_color='red')
            elif rc.password == '':
                sg.cprint('密码不能为空。', text_color='red')
            elif rc.start_date == '{}' or rc.end_date == '{}':
                sg.cprint('请设置起止时间。', text_color='red')
            elif import_path == '':
                sg.cprint('配置文件不能为空。', text_color='red')
            elif export_path == '':
                sg.cprint('导出路径不能为空, 写入文件失败', text_color='red')
            else:
                f = open(import_path)
                sg.cprint('读取配置文件查询路径：', text_color='green')
                window.Refresh()

                i = 1
                logs = []
                lines = f.read()
                for path in lines.split('\n'):
                    if path == '':
                        sg.cprint('-- 空行 + 1。', text_color='grey')
                        window.Refresh()
                        continue

                    rc.svn_path = path
                    sg.cprint(str(i) + '. ' + path)
                    window.Refresh()
                    i = i + 1

                    log = read_svn_log(rc, window)

                    if log[0] == 'err':
                        sg.cprint("SVN读取失败", text_color='red')
                        sg.cprint(log[1], text_color='orange')
                        window.Refresh()
                    else:
                        logs = logs + log

                if logs:
                    sg.cprint("SVN读取成功，准备写入文件...", text_color='green')
                    window.Refresh()

                    book = xlwt.Workbook(encoding='utf-8')
                    sheet_name = rc.start_date + '~' + rc.end_date
                    sheet = book.add_sheet(sheet_name, cell_overwrite_ok=True)

                    sheet.write(0, 0, '版本号(Revision)')
                    sheet.write(0, 1, '提交时间(Time)')
                    sheet.write(0, 2, '提交用户(Author)')
                    sheet.write(0, 3, '提交日志(Message)')
                    sheet.write(0, 4, '(提交文件,行为类型)(Path_Action)')

                    i = 1
                    for log in logs:
                        j = 0
                        for col in str(log).split('##'):
                            sheet.write(i, j, col)
                            j = j + 1
                        i = i + 1

                    excel_name = 'svn_export_' + rc.username + '_' + dt.datetime.now().strftime('%Y%m%d%H%M%S') + '.xls'
                    book.save(os.path.join(export_path, excel_name))

                    sg.cprint("文件写入成功, 文件名：", excel_name, text_color='green')
                    window.Refresh()

                window['-LOADING-'].update(visible=False)
                window.Refresh()
                # window['-END-'].update(visible=True)
                sg.cprint(
                    dt.datetime.now().strftime('%Y-%m-%d %H:%M:%S'), '程序运行结束.',
                    end=None,
                    sep="，",
                    text_color='green',
                    justification='l'
                )
                window.Refresh()

    # 关闭窗口
    window.close()
